  const [data, setData] = useState(null);

  const getData = async() => {
    const { data: {results}} = await axios.get('https://corshttps://www.freetogame.com/api/games')
    console.log(results);
  }

  useEffect(() => {
    getData()

  },[url])
  if(!data){
    return <Loading/>
  }
  return (
      <ReposDiv data={data}/>
  )
}

export default Repos
